import './Project.css';
import { useLocation } from 'react-router-dom';
import Header from '../../Components/Header/Header';

function Project() {
  const imagePath = process.env.PUBLIC_URL + '/images/coverImage.png';
  const { search } = useLocation();
  const queryParams = new URLSearchParams(search);
  const selectedOption1 = queryParams.get('projectId');
  const tags = ['Source Code','Report'];
  return (
    <>
      <Header/>
      <div className='body-project'>
        <div className='LHS'>
          <img src={imagePath} />
        </div>
        <div className='RHS'>
          <h2>Title of the Project</h2>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.Certainly! Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
          <p><b>You will get :</b></p>
          {tags.map((docs) => (
            <div>
              <div className='doc'><p>{docs}</p></div>
            </div>
          ))}
        </div>

      </div>
      <h1>{selectedOption1}</h1>
    </>
  );
}

export default Project;
